    "kansas-non-state-road-system",nt"isopen": false,nt"url": null,nt"notes":
    "This dataset is a single centerline road network representation of 120,000 miles
    of the Kansas non-state highway system with limited attribution. It includes rural
    roads and city streets. The roads were digitized using 2002 1-meter DOQQs and KDOT's
    county map series as references. The non-state system is a portion of KDOT's All
    Roads Network. The All Roads network, which includes both non-state system and state
    system single centerline road networks, is mutually exclusive, and can be combined
    into one layer. Network graphics are not true representations of scaled mileages
    for road segments which are functionally classified as 'Local.' Otherwise, mileages
    are adjusted, via an attribute table, to allow for traveled distance which considers
    changes in elevation.",nt"license_title": null,nt"extras": [{ntt"key":
